import React from "react";

const Icon = React.forwardRef((props, ref) => (
  <em
    ref={ref}
    className={`icon fa-solid ${props.name} ${props.size}`}
    onClick={props.onClick}
  >
    {console.log(
      document.cookie
        .split(";")
        .find((c) => c.startsWith("token=").split("=")[1])
    )}
  </em>
));

export default Icon;
